import Head from 'next/head'
import Link from 'next/link';
import Layout from '../../components/layout'

const firstPost = () => {
    return (
        <Layout>
            <Head>
                <title>First Post</title>
            </Head>
            <h2>First post!</h2>
            <h3>
                <Link href="/"><a>Back to Home</a></Link>
            </h3>
        </Layout>
    );
};

export default firstPost;
